CREATE TABLE `product` (
  `productID` char(16) NOT NULL,
  `sellerID` char(10) NOT NULL,
  `productName` varchar(20) NOT NULL,
  `aboutProduct` varchar(200) NOT NULL,
  `productPrice` int NOT NULL,
  `category` enum('Beds','Mattresses','Chairs','Tables','Dining','Sofas','Wardrobes','Other') NOT NULL,
  `dimensionsHeight` decimal(4,2) DEFAULT NULL,
  `dimensionsWidth` decimal(4,2) DEFAULT NULL,
  `dimensionsLength` decimal(4,2) DEFAULT NULL,
  `productWeight` decimal(6,2) DEFAULT NULL,
  `material` varchar(20) DEFAULT NULL,
  `brand` varchar(20) DEFAULT NULL,
  `avgRating` decimal(3,2) DEFAULT NULL,
  `discountMultiplier` decimal(4,3) NOT NULL,
  `stock` int NOT NULL,
  `images` blob,
  PRIMARY KEY (`productID`),
  KEY `sellerID` (`sellerID`),
  CONSTRAINT `product_ibfk_1` FOREIGN KEY (`sellerID`) REFERENCES `seller` (`sellerID`) ON DELETE CASCADE,
  CONSTRAINT `product_chk_1` CHECK (((`dimensionsHeight` > 0.0) and (`dimensionsWidth` > 0.0) and (`dimensionsLength` > 0.0))),
  CONSTRAINT `product_chk_2` CHECK ((`productWeight` > 0.0)),
  CONSTRAINT `product_chk_3` CHECK (((`avgRating` >= 0.0) and (`avgRating` <= 5.0))),
  CONSTRAINT `product_chk_4` CHECK ((`stock` >= 0)),
  CONSTRAINT `product_chk_5` CHECK (((`discountMultiplier` >= 0.0) and (`discountMultiplier` <= 1.0))),
  CONSTRAINT `product_chk_6` CHECK (((`productPrice` > 0) and (`productPrice` < 1000000)))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
